  "vs/platform/extensions/node/extensionValidator": ["Impossible d'analyser la valeur {0} de 'engines.vscode'. Utilisez, par exemple, ^0.10.0, ^1.2.3, ^0.11.0, ^0.10.x, etc.", "La version spécifiée dans 'engines.vscode' ({0}) n'est pas assez précise. Pour les versions de vscode antérieures à 1.0.0, définissez au minimum les versions majeure et mineure souhaitées. Par exemple : ^0.10.0, 0.10.x, 0.11.0, etc.", "La version spécifiée dans 'engines.vscode' ({0}) n'est pas assez précise. Pour les versions de vscode ultérieures à 1.0.0, définissez au minimum la version majeure souhaitée. Par exemple : ^1.10.0, 1.10.x, 1.x.x, 2.x.x, etc.", "L'extension n'est pas compatible avec le code {0}. L'extension nécessite {1}.", "Description d'extension vide obtenue", "la propriété '{0}' est obligatoire et doit être de type 'string'", "la propriété '{0}' est obligatoire et doit être de type 'string'", "la propriété '{0}' est obligatoire et doit être de type 'string'", "la propriété '{0}' est obligatoire et doit être de type 'object'", "la propriété '{0}' est obligatoire et doit être de type 'string'", "la propriété '{0}' peut être omise ou doit être de type 'string[]'", "la propriété '{0}' peut être omise ou doit être de type 'string[]'", "les propriétés '{0}' et '{1}' doivent être toutes les deux spécifiées ou toutes les deux omises", "La propriété '{0}' peut être omise ou doit être de type 'string'", "'main' ({0}) est censé être inclus dans le dossier ({1}) de l'extension. Cela risque de rendre l'extension non portable.", "les propriétés '{0}' et '{1}' doivent être toutes les deux spécifiées ou toutes les deux omises", "La version de l'extension n'est pas compatible avec SemVer."],
